import PropTypes from 'prop-types';

export default function Contacts({ name, number }) {
  return (
    <li>
      <span>
        {name}: {number}
      </span>
      ;
    </li>
  );
}

FriendListItem.propTypes = {
  name: PropTypes.string.isRequired,
  number: PropTypes.number.isRequired,
};
